import {StrictMode} from 'react';
import {createRoot} from 'react- dom/client';
import App from './App';

/*
pour faire un rendu
de App va decouler toute notre application -> tous les composants
Ensuite on passe toute notre applicaton a document.getElementById("root") 
id(root) est dans index.html
toute l'app sera dans  <div id="root"></div>
*/
ReactDOM.render(
  <React.StrictMode>
    <App /> 
  </React.StrictMode>,
  document.getElementById('root')
);
